(124, 1, 2, 23, '<p>Restoran yang anda rintis sejak lama saat ini sudah mulai menampakkan hasilnya dan menjadi salah satu restoran favorit di kota anda. Banyak pengunjung yang datang, baik dari dalam kota maupun luar kota karena ingin mencoba makanan di restoran yang sering membuat restoran penuh dan membuat beberapa tamu menunggu. Melihat keberhasilan ini saya sangat senang dan terus berusaha untuk meningkatkan pelayanan. Hal pertama yang terlintas dalam rencana peningkatan layanan adalah ….</p>', '<p><strong>Kunci Jawaban&nbsp;&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp; B&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;&nbsp;&nbsp;&nbsp;E&nbsp;&nbsp;&nbsp;&nbsp;D</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c5,d1,e2', '2023-07-19 22:05:26', '2023-07-20 01:27:43'),
(125, 1, 2, 24, '<p>Anda merupakan kepala bagian kepegawaian di sebuah instansi. Suatu hari salah seorang pegawai mengenakan seragam yang sudah dimodifikasi sehingga lebih sesuai dengan pemahaman agama yang diyakini. Permasalahannya bentuk seragam tidak sesuai dengan peraturan tentang seragam pegawai di instansi tempat anda bekerja. Anda akan ….</p>', '<p><strong>Kunci Jawaban&nbsp;&nbsp;&nbsp;&nbsp;B&nbsp;&nbsp;&nbsp;&nbsp;E&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp;&nbsp;D</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b5,c2,d1,e4', '2023-07-19 22:11:04', '2023-07-20 01:27:23'),
(126, 1, 2, 23, '<p>Pada suatu waktu rekan kerja saya kesulitan menyiapkan bahan presentasi, padahal lima menit lagi dia harus&nbsp; mempresentasikan hasil pekerjaan di hadapan para atasan. Pada waktu itu saya sedang dalam kondisi sibuk dengan pekerjaan saya. Yang saya lakukan adalah ….</p>', '<p><strong>Kunci Jawaban: DCEAB</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a2,b1,c4,d5,e3', '2023-07-19 22:13:27', '2023-07-20 01:27:03'),
(127, 1, 2, 24, '<p>Pimpinan memberikan tugas baru kepada anda dan tim anda. Tugas tersebut merupakan tugas yang baru dan belum pernah anda kerjakan sebelumnya. Begitu juga dengan rekan tim yang lain, mereka merasa kebingungan dan belum memahami maksud dan cara mengerjakan tugas baru tersebut. Sikap anda ….</p>', '<p>Kunci Jawaban: DACEB</p><p>Pembahasan cek dikelas zoom</p>', 'a4,b1,c3,d5,e2', '2023-07-19 22:21:15', '2023-07-20 01:26:47'),
(128, 1, 2, 27, '<p>Warga perumahan di tempat anda sepakat untuk mengadakan ronda siskamling secara bergiliran. Sementara jadwal harian anda sangat padat dan terkadang sampai rumah larut malam. Anda akan ….</p>', '<p><strong>Kunci Jawaban: CABDE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b3,c5,d2,e1', '2023-07-19 22:23:20', '2023-07-20 01:26:32'),
(129, 1, 2, 24, '<p>Saya baru saja diterima menjadi seorang Pegawai Negeri Sipil. Bulan depan akan dilaksanakan diklat dan harus dikarantina selama dua bulan. Sementara di sisi lain, saya juga akan memasuki bulan-bulan akhir kuliah pascasarjana yang sudah saya tempuh jauh sebelum diterima sebagai PNS. Saya akan ….</p>', '<p><strong>Kunci Jawaban: BDACE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b5,c2,d4,e1', '2023-07-19 22:25:49', '2023-07-20 01:26:13'),
(130, 1, 2, 23, '<p>Sebagai seorang analisis data di sebuah instansi pemerintah daerah, tugas saya adalah mengumpulkan, dan menganalisa data dari seluruh desa di kabupaten. Seluruh desa sudah mendapatkan pelatihan tentang pengumpulan dan penyajian data untuk pemerintah daerah. Namun ada beberapa desa yang memberikan saya data mentah yang belum diolah. Saya akan …</p>', '<p><strong>Kunci Jawaban: EBACD</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c2,d1,e5', '2023-07-19 22:42:48', '2023-07-20 01:25:53'),
(131, 1, 2, 24, '<p>Sebagai seorang bendahara gaji di sebuah instansi, saya dituntut untuk bekerja dengan cepat dan teliti. Sejauh ini saya dapat memenuhi semua tuntutan pekerjaan dengan baik, sampai datang sebuah keputusan bahwa semua laporan gaji dan keuangan dianjurkan menggunakan sebuah software baru yang tidak saya kuasai sama sekali. Saya akan ….</p>', '<p><strong>Kunci Jawaban: CBADE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c5,d2,e1', '2023-07-19 22:44:20', '2023-07-20 01:25:37'),
(132, 1, 2, 23, '<p>Perusahaan mengadakan pelatihan terkait peningkatan kualitas sumber daya manusia dalam penggunaan teknologi dan informasi di era digital. Sebagai kepala divisi saya akan…</p>', '<p><strong>Kunci Jawaban: CEBAD</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a2,b3,c5,d1,e4', '2023-07-19 22:45:58', '2023-07-20 01:25:24'),
(133, 1, 2, 24, '<p>Dalam sebuah grup alumni sekolah, seorang teman mengirimkan sebuah pesan berita yang mendiskreditkan pemerintah. Saya yang mengetahui bahwa berita tersebut merupakan berita hoaks yang sangat jauh dari kenyataan sebenarnya. Saya akan ….</p>', '<p><strong>Kunci Jawaban: BACED</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b5,c3,d1,e2', '2023-07-19 22:47:35', '2023-07-20 01:25:11'),
(134, 1, 2, 24, '<p>Seorang warga baru datang dan mengontrak rumah di sebelah rumah anda. Ternyata dalam pergaulan social dia sangat tertutup dan tidak bergaul dengan tetangga. Berdasarkan pengamatan, Anda mencurigai dia terkait dengan salah satu paham radikal. Yang anda lakukan adalah ….</p>', '<p><strong>Kunci Jawaban: BACED</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b5,c3,d1,e2', '2023-07-19 22:50:13', '2023-07-20 01:24:56'),
(135, 1, 3, 34, '<p>Sehari setelah Indonesia merdeka, Pancasila disahkan sebagai Dasar Negara. Namun pada saat Sidang PPKI ke 1, terjadi perdebatan atau polemik mengenai tujuh kata pada sila pertama. Anggota non muslim PPKI Johanes Latuharhary, Sam Ratulangi dan I.G.Ketoet Poedja mengusulkan agar tujuh kata sila pertama dihapus. Beberapa golongan muslim seperti Ki Bagoes Hadikoesoemo ingin tujuh kata itu tetap ada. Setelah dilakukan loby, hingga akhirnya mereka bermufakat untuk menghapus tujuh kata itu, dan menjadi “Ketuhanan Yang Maha Esa”. Melihat peristiwa tersebut, hal yang tidak bisa kita ambil hikmahnya adalah….</p>', '<p>Pembahasan cek dikelas zoom</p>', '3', '2023-07-20 08:40:33', '2023-07-20 08:40:33'),
(136, 1, 3, 34, '<p>Pada saat sidang PPKI ke 1, disahkan juga Soekarno dan Hatta sebagai Presiden dan Wakil Presiden. Terkait tentang pelaksanaan pemilihan presiden dan wakil presiden merupakan cerminan nilai Pancasila yaitu….</p>', '<p>Pembahasan cek dikelas zoom</p>', '3', '2023-07-20 08:41:53', '2023-07-20 08:41:53'),
(137, 1, 3, 34, '<p>Baru-baru ini Indonesia di hebohkan dengan kasus pembunuhan Brigadir Yosua. Kini kasus tersebut memasuki tahap akhir. Sidang vonis untuk Ferdy Sambo dan Putri Candrawati telah digelar dan memutuskan Sambo dihukum mati dan Putri divonis 20 tahun penjara. Adapun kasus pembunuhan terhadap Brigadir Yosua telah melanggar pengamalan Pancasila yakni sila ke….</p>', '<p>pembahasan cek dikelas zoom</p>', '1', '2023-07-20 08:42:41', '2023-07-20 08:42:41'),
(138, 1, 3, 34, '<p>Isu-isu kontemporer sudah banyak terjadi di Indonesia ini. Salah satunya adalah kasus penyalahgunaan narkoba yang dilakukan oleh sejumlah artis. Berita terkait penyalahgunaan Narkoba yang dilakukan oleh Ammar Zoni sangat menjadi perhatian publik. Menurut polisi, Ammar Zoni sudah sering mengonsumsi narkotika jenis sabu sebelum akhirnya ditangkap pada Rabu malam. Penyalahgunaan narkoba dapat memecah belah bangsa, dan juga bertentangan dengan Pancasila sila ke….</p>', '<p>Pembahasan cek dikelas zoom</p>', '2', '2023-07-20 08:43:29', '2023-07-20 08:43:29'),
(139, 1, 3, 34, '<p>Kasus kematian Vanessa Angel dan suaminya Febri Ardiansyah dikabarkan terjadi akibat kecelakaan di Tol Jombang. Dengan adanya kasus tersebut, kehidupan keluarganya pun ikut tersorot. Termasuk kehidupan adiknya Febri Ardiansyah yakni “Fuji Utami Putri” yang mendadak viral karena kejadian tersebut. Banyak netizen yang menghujat Fuji karena menjadi terkenal karena adanya musibah. Diskriminasi terhadap fuji seharusnya tidak boleh dilakukan, dengan alasan…..</p>', '<p>Pembahasan cek dikelas zoom</p>', '1', '2023-07-20 08:45:10', '2023-07-20 08:45:10'),
(140, 1, 3, 34, '<p>Andi merupakan Pegawai Negeri Sipil di suatu Instansi Pemerintah Daerah. Di Instansi tersebut terdapat banyak latar belakang pegawai yang berbeda-beda. Mulai dari berbeda suku, adat, agama dan budaya. Namun , hal itu tidak menjadi permasalahan karena mereka selalu bersatu. Dalam setiap rapat yang dilaksanakan selalu diputuskan dengan kesepakatan bersama. Bahkan dijam istirahatpun, seluruh pegawai selalu memberi kesempatan bagi pegawai lain yang akan beribadah. Hubungan kerja yang harmonis dan saling tenggang rasa membuat kehidupan di kantor Andi sangat kondusif.&nbsp;</p><p>Melihat peristiwa diatas, hal yang mencerminkan pengamalan Pancasila sila ke tiga adalah…..</p>', '<p>Pembahasan cek dikelas zoom</p>', '1', '2023-07-20 08:47:22', '2023-07-20 08:47:22'),
(141, 1, 3, 34, '<p>Rini merupakan warga perumahan harau residence. Untuk mempererat tali persaudaraan dan persatuan, setiap satu bulan sekali diadakan arisan dan makan bersama. Gotong royong membersihkan halaman wargapun rutin dilakukan setiap dua minggu sekali. Suatu ketika terdapat warga yang mengalami sakit, dan seluruh wargapun mengumpulkan dana untuk membelikan obat. Sehingga ketika warga sakit tersebut ada jadwal pos ronda, seluruh wargapun berkumpul untuk membahas jadwal pengganti.</p><p>Melihat kisah diatas hal yang mencerminkan pengamalan Pancasila sila ke dua adalah….</p>', '<p>Pembahasan cek dikelas zoom</p>', '2', '2023-07-20 08:49:00', '2023-07-20 08:49:00'),
(142, 1, 3, 34, '<p>Perhatikan pernyataan berikut ini :</p><ol><li>Siny merupakan anak yang rajin belajar</li><li>Dita melakukan usaha demi menghidupi keluarganya</li><li>Pelayan toko melayani pelanggan dengan sikap ramah tamah</li><li>Indonesia bekerja sama dengan Negara Lain dalam membangun kereta cepat</li><li>Pabrik keripik telah dilakukan analisis dampak lingkungan sebelum melakukan pembangunan</li><li>Budaya Tari harus dilestarikan oleh generasi penerus bangsa</li></ol><p>Berdasarkan pernyataan diatas yang merupakan pengmalan Pancasila sila ke 5 yaitu….</p>', '<p>Pembahasan cek dikelas zoom</p>', '4', '2023-07-20 08:50:28', '2023-07-20 08:50:28'),
(143, 1, 3, 34, '<p>Perhatikan pernyataan berikut ini :</p><ol><li>Seluruh Mahasiswa diwajibkan membuang sampah pada tempatnya</li><li>Ekstrakulikuler gamelan digalakan di pemerintah jawa barat</li><li>Makanan khas minang menjadi makanan kuliner internasional</li><li>Pemberian penghargaan diberikan kepada siswa berprestasi</li><li>Seluruh tamu undangan diwajibkan menonton film terkait proklamasi kemerdekaan</li><li>Ketika orang lain sedang berpuasa hendaknya tidak makan didepan orang tersebut</li></ol><p>Berdasarkan pernyataan diatas yang merupakan pengamalan Pancasila sila ke 3 yaitu….</p>', '<p>Pembahasan cek dikelas zoom</p>', '2', '2023-07-20 08:52:16', '2023-07-20 08:52:16'),
(144, 1, 3, 34, '<p>Masyarakat Indonesia terkenal dengan keramah tamahanya. Sehingga banyak wisatawan asing yang datang ke Indonesia. Perlunya melestarikan sikap ramah tamah merupakan salah satu bentuk pengamalan Pancasila sebagai kepribadian bangsa. Dimana yang perlu kita tekankan untuk mewujudkan hal tersebut sebagai abdi negara adalah……</p>', '<p>Pembahasan cek dikelas zoom</p>', '1', '2023-07-20 08:53:36', '2023-07-20 08:53:36'),
(145, 1, 3, 34, '<p>Dalam kehidupan berbangsa dan bernegara kita di tuntut untuk saling menghargai perbedaan suku, adat, agama maupun budaya. Sehingga didalam masyarakat majemuk ini kita sebagai generasi penerus bangsa harus bisa menempatkan diri agar tidak terjadi konflik masyarakat. Hubungan fungsi Pancasila sebagai falsafah hidup bangsa dengan kebhinekaan adalah….</p>', '<p>Pembahasan cek dikelas zoom</p>', '3', '2023-07-20 08:54:53', '2023-07-20 08:54:53'),
(146, 1, 3, 34, '<p>Konstitusi adalah salah satu norma hukum dibawah dasar negara. UUD 1945 pertama kali dibahas pada saat sidang BPUPKI. Sehingga pada akhirnya di sidang PPKI pertama UUD 1945 disahkan menjadi konstitusi dan hukum dasar tertulis. Adapun yang bukan menjadi alasan mengapa sebuah negara harus memiliki hukum dasar tertulis yaitu…..&nbsp;</p>', '<p>Pembahasan cek dikelas zoom</p>', '3', '2023-07-20 08:56:13', '2023-07-20 08:56:13'),
(147, 1, 3, 34, '<p>Berdasarkan UUD 1945 setelah amandemen, terdapat perbedaan dari tugas MPR. Yakni MPR saat ini tidak lagi menetapkan GBHN. Adapun hal yang menjadi alasan penting mengapa GBHN tidak lagi digunakan adalah……</p>', '<p>Pembahasan cek dikelas zoom</p>', '0', '2023-07-20 08:58:19', '2023-07-20 08:58:19'),
(148, 1, 3, 34, '<p>Dalam perumusan UU harus selalu diujikan terhadap UUD 1945. Sehingga diperlukan pembuatan Mahkamah Konstitusi. Dimana fungsi dari MK yaitu untuk menguji UU terdahap UUD 1945 yang dalam hal ini berkaitan dengan….</p>', '<p>Pembahasan cek dikelas zoom</p>', '2', '2023-07-20 08:59:38', '2023-07-20 08:59:38'),
(149, 1, 3, 34, '<p>Dewasa ini ketika kita melihat seorang pengendara menerobos lampu lalu lintas, hal yang bisa kita lakukan adalah…..</p>', '<p>Pembahasan cek dikelas zoom</p>', '2', '2023-07-20 09:03:13', '2023-07-20 09:03:13'),
