(167, 1, 3, 34, '<p>Akhir-akhir ini terdapat berita yang menghebohkan dunia maya. Yakni sepasang anjing yang digelar pernikahan mewah oleh pemiliknya. Namun hal ini menuai banyak kontroversi, pasalnya seorang Romo yang terlihat seolah melakukan sesuatu yang melanggar nilai agama. Berdasarkan hal tersebut, jika terdapat sesuai yang melanggar nilai keagamaan telah menciderai Pancasila sila ke….</p>', '<p>Segala sesuatu yang menciderai nilai-nilai aga mini merupakan pelanggaran nilai Pancasila sila ke 1.</p>', '0', '2023-07-21 08:32:59', '2023-07-21 08:32:59'),
(168, 1, 3, 34, '<p>Berita perselingkuhan artis telah menuai kontroversi publik. Banyak artis yang kisah rumah tangganya berakhir karena perselingkungan. Sehingga perceraian terjadi karena adanya perselingkuhan tersebut. Kegaduhan dan keresahan kasus tersebut telah menimbulkan banyak dampak negative dari banyak pihak. Terkait hal tersebut, telah melanggar Pancasila sila ke….</p>', '<p>Kata Kunci : “Menyebabkan keresahan dan kegaduhan”</p><p>Pembahasan : Hal yang menyebabkan keresahan dan kegaduhan artinya menyebabkan perpecahan antar manusia atau kelompok. Jika hal tersebut terjadi, maka telah melanggar Pancasila sila ke 3.</p>', '2', '2023-07-21 08:33:35', '2023-07-21 08:33:35'),
(169, 1, 3, 34, '<p>Kerusakan jalan di Provinsi Lampung belakangan ini turut menjadi perhatian publik. Hal ini tentu merugikan banyak pihak termasuk masyarakat yang sering melalui jalan tersebut. Agar hal tersebut tidak terjadi lagi dimasa yang akan datang, apa yang seharusnya dilakukan oleh kita sebagai abdi negara di bidang pekerjaan umum….</p>', '<p>Sebagai seorang abdi negara di bidang pekerjaan umum, hal yang harus dilakukan untuk mengantisipasi kerusakan jalan adalah dengan cara “Melaksanakan kebijakan public dengan sebaik-baiknya dalam menanggulangi jalan rusak.</p>', '0', '2023-07-21 08:34:50', '2023-07-21 08:34:50'),
(170, 1, 3, 34, '<p>Jika RAPBN yang diajukan oleh presiden tidk disetujui DPR, maka anggaran pendapatan belanja yang digunakan adalah menggunakan RAPBN tahun lalu, mengapa demikian?</p>', '<p>Jika RAPBN yang diajukan oleh presiden tidk disetujui DPR, maka anggaran pendapatan belanja yang digunakan adalah menggunakan RAPBN tahun lalu hal ini Karena sesuai yang tercantum didalam UUD 1945 terkait hal budget DPR, yakni DPR bisa menolak atau menerima RAPBN yang diusulkan atau diajukan oleh presiden.</p>', '2', '2023-07-21 08:36:49', '2023-07-21 08:36:49'),
(171, 1, 3, 34, '<p>Didalam UUD 1945 memuat hal terkait presiden berhak menyatakan perang. Hal ini memiliki maksud yakni….</p>', '<p>Didalam UUD 1945 memuat hal terkait presiden berhak menyatakan perang. Hal ini memiliki maksud yakni “Untuk menunjukan bahwa militer ada di bawah kendali pemerintahan dan presiden sebagai personifikasi negara.”</p>', '4', '2023-07-21 08:37:56', '2023-07-21 08:37:56'),
